import { Icon, IconAbsolute } from "../components/IconComponent/Icon";

export enum COLORS {
  ORANGE = "#FFA552",
  BLUE = "#1890FF",
  POLARGREEN = "#52C41A",
  BLACK = "#293452",
}
export enum ICONSTATUS{
  DONE = "Done",
  INPROCESS = "InProcess",
  CANCELED = "Canceled",
  CLOCK = "Clock",
}
